import React from 'react';

class ShowClassroom extends React.Component {


    render() {
        return (
            <div>
                <h1>{this.props.classroom}</h1>
                <button className="btn btn-lg btn-secondary" onClick={this.props.showDashboard}>Back</button>
            </div>
        );
    }
}

export default ShowClassroom;
